INSERT INTO `informazioni` (`id`, `id_azienda`, `titolo`, `descrizione`) VALUES
(1, 47, 'Esperienze precedenti', 'Andato tutto bene con i precedenti alunni.');
INSERT INTO `mansioni` (`id`, `titolo`, `descrizione`) VALUES
('ELE07', 'Assemblatore di schede elettroniche (PCB)', 'La figura ha il suo focus su assemblaggio e saldatura a stagno di circuiti e schede elettroniche, con possibilità di relativo collaudo.'),
('ELE05', 'Installatore/Manutentore di impianti/sistemi di automazione', 'la figura si prefigge di: leggere e creare schemi elettrici, topografici, planimetrici anche con l''ausilio di strumenti informatici collaborare nella messa a punto degli impianti elettrici, nella regolazione delle apparecchiature e nella fase di collaudo eseguire l''installazione di impianti elettrici, delle verifiche, della ricerca di eventuali anomalie e loro riparazione analizzare la documentazione tecnica, i capitolati e le specifiche del committente programmare automatismi di comando e movimentazione con PLC.'),
('ELE02', 'Cablatore/Manutentore di impianti elettrici.', 'La figura effettua il cablaggio e messa in opera dei quadri elettrici bordo macchina per l’automazione civile e industriale.  Inoltre installa sistemi e apparecchiature elettroniche.'),
('ELE03', 'Addetto alla diagnosi elettronica dell''autoveicolo', 'La figura professionale è in grado di eseguire, su precise indicazioni, operazioni di manutenzione leggera dell’auto, con interventi di normale difficoltà su complessivi e loro parti è inoltre in grado di individuare, con l’uso di attrezzature specifiche, anomalie di funzionamento dell’autoveicolo.'),
('ELE01', 'Collaudatore di schede elettroniche', 'La figura verifica che il funzionamento della scheda elettronica risponda ai requisiti di corretto funzionamento stabiliti in fase di progetto. A tal scopo utilizza apposita strumentazione elettronica di misurazione per effettuare test diagnostici.'),
('CML03', 'Tecnico per l''assistenza tecnica a linee di produzione automatizzate.', 'Gestisce il corretto funzionamento di linee di produzione automatizzate dal punto di vista dei tempi e della qualità produttiva, assicurando la manutenzione ordinaria e straordinaria.'),
('CML01', 'Tecnico manutenzione e riparazione di mezzi di trasporto e di macchina industriali', 'Opera nell''ambito della riparazione e manutenzione conto terzi di mezzi di trasporto, macchine e attrezzature di produzione, sia in officina che presso i siti produttivi dei clienti.'),
('FABLAB', '', ''),
('INF01', 'Tecnico programmatore', 'Le professioni classificate in questa unità assistono i progettisti e analisti di software traducendo istruzioni e specifiche di controllo, di procedure o di soluzioni di problemi, in diagrammi logici di flusso per la programmazione in linguaggio informatico sviluppando e scrivendo programmi per memorizzare, ricercare ed elaborare informazioni e dati.'),
('LOG01', 'Responsabile di magazzino e della distribuzione interna', 'Gestiscono la movimentazione interna ai magazzini, ne valutano la qualità, provvedono alla eventuale formazione di UdC o imballaggi vari, gestiscono il picking e l’allocazione interna delle merci valutando tempi e costi.'),
('ELE08', 'Assemblatore/Riparatore di Personal Computer - Installatore Di Lan', 'La figura si riferisce a un tecnico assemblatore PC, il quale, oltre a conoscere la logica di funzionamento dei personal computers, è in grado di installare e configurare i vari componenti, risolvere eventuali problemi relativi all''hardware e al software, scegliere i componenti adeguati per ottimizzare al meglio il PC e valutarne le prestazioni. Attua l''installazione, configurazione e manutenzione di reti informatiche locali.'),
('ELE10', 'Progettista sviluppatore di sistemi elettronici programmabili', 'Opera nella progettazione e sviluppo di sistemi elettronici programmabili. Utilizza CAD elettronici per la stesura di schemi elettrici e per sviluppo PCB. Sviluppa programmi per il test ed il collaudo del prototipo del sistema.'),
('ELN02', 'Cablatore/Manutentore di impianti elettrici.', 'La figura effettua il cablaggio e messa in opera dei quadri elettrici bordo macchina per l’automazione civile e industriale.  Inoltre installa sistemi e apparecchiature elettroniche.'),
('ELN05', 'Installatore/Manutentore di impianti/sistemi di automazione.', 'la figura si prefigge di: leggere e creare schemi elettrici, topografici, planimetrici anche con l''ausilio di strumenti informatici collaborare nella messa a punto degli impianti elettrici, nella regolazione delle apparecchiature e nella fase di collaudo eseguire l''installazione di impianti elettrici, delle verifiche, della ricerca di eventuali anomalie e loro riparazione analizzare la documentazione tecnica, i capitolati e le specifiche del committente programmare automatismi di comando e movimentazione con PLC.'),
('INF02', 'Sviluppatore di applicazioni per il web e multimediali', 'Le professioni comprese in questa unità si occupano dell''ideazione, della realizzazione, dell''integrazione e della verifica dei software impiegati in un sito o in un''applicazione web. Progettano dal punto di vista funzionale siti e applicazioni web, scelgono le tecnologie più adatte in termini di costi, efficienza e affidabilità programmano le funzionalità necessarie eseguono test e simulazioni per valutare l''accessibilità, l''usabilità, la robustezza e la sicurezza delle soluzioni realizzate.'),
('INF03', 'Tecnico gestore di database', 'Le professioni comprese in questa unità analizzano, progettano, sviluppano e collaudano i sistemi di gestione di banche dati, garantendone e controllandone le prestazioni ottimali e la sicurezza. Definiscono e predispongono i sistemi di backup e le procedure per preservare la sicurezza e l''integrità dei dati.'),
('INF04', 'Tecnico gestore di reti e di sistemi telematici', 'Le professioni comprese in questa unità analizzano, progettano, testano, valutano e ottimizzano le prestazioni dei sistemi di rete e di telecomunicazione.'),
('INF05', 'Addetto al customer care', 'Le professioni classificate in questa unità assistono i clienti e forniscono supporto tecnico sia telefonicamente che con intervento diretto, occupandosi del trouble-shooting, dell’installazione, configurazione e manutenzione di hardware e software, con particolare riguardo alla gestione della relazione con il cliente, dei contratti di manutenzione e delle norme relative alla sicurezza nell’ambiente di lavoro.'),
('INF06', 'Addetto alla manutenzione hardware e software', 'Le professioni comprese in questa unità installano, riparano e testano apparecchiature informatiche installano, mantengono e sostituiscono parti di personal computer e delle loro componenti periferiche.'),
('INF07', 'Amministratore di sistemi', 'Le professioni classificate in questa unità assistono i progettisti e amministratori di sistemi installando, configurando, gestendo e mantenendo per gli aspetti software i sistemi telematici ed i relativi sistemi di sicurezza.'),
('INF08', 'Addetto alla sicurezza informatica', 'Le professioni comprese in questa unità disegnano, coordinano ed implementano le misure di sicurezza dei sistemi informativi per regolare gli accessi ai dati e prevenire accessi non autorizzati.'),
('LOG03', 'Tecnico della gestione dei processi produttivi di beni e servizi', 'Applicano procedure, regolamenti e tecnologie proprie per gestire, controllare, organizzare e garantire l''efficienza e la corretta erogazione dei servizi e ne verificano la qualità.'),
('LOG04', 'Tecnico approvvigionatore e responsabile acquisti', 'Assistono gli specialisti negli acquisti sul mercato di beni, attrezzature, materie prime e forniture di servizi ovvero attivano e seguono le procedure di valutazione dei prezzi di mercato, della qualità e delle caratteristiche delle merci da acquistare, di scelta dei fornitori e di acquisizione dei beni.'),
('LOG05', 'Tecnico della vendita e della distribuzione', 'Assistono gli specialisti nella implementazione delle strategie di vendita delle imprese, nel controllo della efficienza della rete distributiva e commerciale e nel monitoraggio delle vendite, applicano le procedure fissate per raccogliere informazioni sulle vendite e sulle attività di distribuzione, per analizzarle, organizzarle e presentarle in maniera rilevante e significativa a specialisti e responsabili del settore.'),
('LOG06', 'Tecnico del trasporto modale ed intermodale', 'Coordina le attività di trasporto( navale, stradale, ferroviario ed aereo) vigilando sul rispetto delle regole e controlla il corretto utilizzo di aree  e beni.'),
('TLC02', 'Tecnico gestore di reti e di sistemi telematici', 'Le professioni classificate in questa unità assistono i progettisti e amministratori di sistemi installando, configurando, gestendo e manutenendo per gli aspetti software i sistemi telematici ed i relativi sistemi di sicurezza.'),
('TLC03', 'Amministratore di sistemi', 'Le professioni comprese in questa unità analizzano, progettano, sviluppano sistemi informatici, controllandone e garantendone le prestazioni ottimali e la sicurezza. Definiscono le modalità di configurazione, di mantenimento e di gestione di reti di computer, dei relativi ambienti di elaborazione e delle operazioni di disaster recovery predispongono le procedure di monitoraggio delle prestazioni dei sistemi informatici e delle reti.'),
('TLC06', 'Tecnici esperti in applicazioni software', 'Le professioni classificate in questa unità assistono i progettisti e analisti di software installando, configurando, gestendo e mantenendo applicazioni software.'),
('TLC07', 'Tecnici per le telecomunicazioni', 'Le professioni classificate in questa unità curano l''installazione, il montaggio, la messa in servizio e la manutenzione delle componenti fisiche di reti informatiche, telefoniche, di impianti radiotelevisivi e satellitari e altre reti di sistemi di informazione elettronica per la trasmissione di dati e immagini.'),
('TLC08', 'Installatori, manutentori e riparatori di apparecchiature informatiche', 'Le professioni comprese in questa unità installano, riparano e testano apparecchiature informatiche installano, manutengono e sostituiscono parti di personal computer e delle loro componenti periferiche.');
